import React, { useState } from 'react';


function HandleClick() {
  const [count, setCount] = useState(0);

  function handleIncrease() {
    setCount(count + 1);
  }

  function handleDecrease() {
    setCount(count - 1);
  }

  return (
    <>
      <p>Count: {count}</p>
      <button onClick={handleIncrease} type="button">Increasement</button>
      <button onClick={handleDecrease} type="button">Decreasement</button>
    </>
  );
}

function Head() {
  const [showHandleClick, setShowHandleClick] = useState(false);

  function handleButtonClick() {
    setShowHandleClick(true);
  }

  const list = ['first ingredient'];

  return (
    <>
      <main className="head-container">
        <form>
          <input
            id='input-field'
            placeholder="e.g. oregano"
            type="text"
            aria-label="Add ingredient"
            name='ingredient'
          />
          {/* type = button to avoid changing URL when submitting */}
          <button onClick={handleButtonClick} type="button">Show HandleClick Component</button>
        </form>
      </main>

      <form>
        <ul>
          {list.map((item, index) => (
            <li key={index}>{item}</li>
          ))}
        </ul>
      </form>

      {showHandleClick && <HandleClick />}
    </>
  );
}

export default Head;
